import React from "react";
import { NavLink } from "react-router-dom";

const Clinician = () => {

    return(
        <div>
    <nav class="navbar navbar-inverse" activeKey={this.state.activeKey} onSelect={this.handleSelect}>
        <div class="container-fluid">
          <div class="navbar-header">
            <a class="navbar-brand" href="#">GPNow</a>
          </div>
          <ul class="nav navbar-nav">
            <NavItem eventKey={1} activeKey={this.state.activeKey} onSelect={this.handleSelect}>
            Online Consulatation
            </NavItem>
            <NavItem eventKey={2} activeKey={this.state.activeKey} onSelect={this.handleSelect}>
            Consultation History
            </NavItem>
            <li><a href="#">Medication</a></li>
            <li>< a href="#">Appointments</a></li>
          </ul>
        </div>
      </nav>

        </div>

    );

};

export default Clinician;
